import React from 'react'
import { Link } from 'react-router-dom'


const links=[{path:"/",title:"HOME",img:""},
{path:"/login",title:"LOGIN"},{path:"/signup",title:"SIGNUP"}]

const NavbarA = () => {
  return (
    <div>
    {links.map((link)=>(
        <Link key={link.path} to={link.path}>{link.title}</Link>
    ))}
    {/* <div style={{display:"flex",width:"75%",margin:"auto"}}>
