        <Link to='/Login' style={{color:"#2266e6",marginLeft:"750px",marginRight:"15px",marginTop:"30px"}} href=''>Log In </Link>
        <span style={{color:"grey",marginTop:"30px"}}>|</span>
        <Link to='/SignUp' style={{color:"#2266e6",marginLeft:"15px",marginTop:"30px"}}>Sign Up</Link>
    </div> */}

    </div>
  )
}

export default NavbarA
